    [],nt"num_tags": 0,nt"name": "2010-northern-san-francisco-bay-area-lidar-portions-of-alameda-contra-costa-marin-napa-san-fran",nt"isopen":
    false,nt"url": null,nt"notes": "This Light Detection and Ranging (LiDAR)
    dataset is a survey of northern San Francisco Bay, California. The project area
    consists of approximately 437 square miles in portions of seven California counties:
    Alameda, Contra Costa, Marin, Napa, San Francisco, Solano, and Sonoma. The project
    design of the LiDAR data acquisition was developed to support a nominal post spacing
    of 1 meter. Fugro EarthData, Inc. acquired 147 flight lines in nine lifts on February
    25, 26, and 28; March 1, 24, and 26; and April 3, 15, and 16, 2010. The data was
    divided into 1500 by 1500 meter cells that serve as the tiling scheme. LiDAR data
    collection was performed with a Piper Navajo twin engine aircraft, utilizing a Leica
    ALS60 MPiA sensor, collecting multiple return x, y, and z as well as intensity data.
    LiDAR data is remotely sensed high-resolution elevation data collected by an airborne
    collection platform. This data of northern San Francisco Bay, California, is classified
    according to the ASPRS classification scheme and was collected at sufficient resolution
    to provide a nominal point spacing of 1 m for collected points. Up to 4 returns
    were recorded for each pulse in addition to an intensity value.",nt"owner_org":
